import React from 'react';

const Ishrana = () => {
  return (
    <div className="container mt-5">
      <h1>Stranica za Ishranu</h1>
      <p>
        Ishrana igra ključnu ulogu u postizanju zdravog života. Pravilno balansirana ishrana može
        pomoći u poboljšanju performansi, oporavku nakon treninga i održavanju općeg zdravlja.
      </p>
      <p>
        Nudimo vam niz informacija o ishrani koje mogu biti od koristi. Za više detalja, možete
        pregledati naš <a href="/ishrana-planovi">katalog planova ishrane</a> i pronaći odgovarajući plan
        koji odgovara vašim ciljevima.
      </p>
      {/* Dodajte ostale komponente ili logiku za ishranu */}
    </div>
  );
};

export default Ishrana;
